@FRITZ!Box Rückmeldung von Fritz bzw. irgendwo in der Online Doku gefunden (Die FRITZ!Box unterstützt:
 USB-Speicher mit maximal vier Partitionen, Partitionen bis zu einer Größe von 4 Terabyte, die Dateisysteme NTFS, FAT/FAT32 und ext2/ext3/ext4) Festplatte wurde mit exFat formatiert, da ich Zugriff durch MAC-Book brauche. Habe jetzt eine NFTS Formatierter festplatte und kann über den Browser auf den NAS-Server mit dem MAC zugreifen. - Die Schreibzugriffbeschränkung für HTFS-Festplatten ist wohl kein Problem in diesem Fall.<br>Info von AVM bzgl. Einbindung von MAC-Rechnern:<br>&quot;Für den Zugriff auf den Speicher (NAS) der FRITZ!Box wird das Netzwerkprotokoll SMB1 benötigt. Da Apple die Unterstützung von SMB1 in macOS 10.15 (Catalina) entfernt hat, ist der SMB-Zugriff mit macOS 10.15 auf den Speicher (NAS) der FRITZ!Box nicht mehr möglich.
<br>Um den SMB-Zugriff wieder zu ermöglichen, arbeiten wir an der Unterstützung von SMB3 durch FRITZ!OS und werden diese in einem Update für die FRITZ!Box bereitstellen. Einen Termin für das Update können wir noch nicht nennen.&quot;

