@Kablehead Well I didn&#39;t have the opportunity to try them all yet, but of all the ones I know I would say without hesitation the PO-32 Tonic for the drum machine, it&#39;s just incredibly FAT ! And as far as synthesizers go, I have a soft spot for the PO-20 Arcade, even if it&#39;s a bit limited, I like its glitch sounds! The thing is that I don&#39;t really like the PO edition like Street Fighters or Mega Man, what bothers me is the fact that you have to play at the same time lol but their sounds are really good !<br>I have the PO-32 Tonic (drum machine), the PO-20 Arcade (digital synth), the PO-24 Office (drum machine) and the PO-33 KO (sequencer sampler). The PO-33 KO is great too, it&#39;s really handy for throwing your samples into your Live, the programmed sounds aren&#39;t great except for the retro line, but its interest is to put your own lines.<br>On the other hand, they all have a big defect, they are really greedy in fuel, whether it is in battery or sector, you have to plan! On sector in a modular system you have to be careful not to chain them with anything! And it&#39;s very fragile even though the pots are holding up, it&#39;s still a printed circuit board ! .... :)) 😅<br>But frankly I love them, they are all monsters ! And clearly if you&#39;re looking for the best PO drum machine, it&#39;s the PO-32 Tonic, currently the best of the pocket range at less than 100 euros! The sounds are powerful, deep and fat!<br>The PO-28 Robot is also nice as a synth, the sounds are quite trippy and always well glitch 😉🙃<br>But you see, if you take care of your equipment, everything is fine!
<br>I&#39;ve had them for 4 years now, and managed to keep them in one piece... or thereabouts 😅.
<br>They are in my modular system and normally they don&#39;t come out, but I&#39;ve been known to pull out one or two to play with...bad idea....especially if there are kids around !😆

